const Toolbar = () => {
    return (
        <div id="toolbar">
            {/* Define your toolbar buttons and options here */}
            <button className="ql-bold">Bold</button>
            <button className="ql-italic">Italic</button>
            {/* Add more toolbar options as needed */}
        </div>
    );
};

export default Toolbar;
